  CONSTRAINT `booking_chk_1` CHECK ((`amount_paid` >= 0)),
  CONSTRAINT `booking_chk_2` CHECK ((`bulk_discount` >= 0))
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
