DROP TABLE IF EXISTS `reviews`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `reviews` (
  `food_rating` int NOT NULL,
  `date_of_posting` datetime NOT NULL,
  `trek_rating` int NOT NULL,
  `camping_rating` int NOT NULL,
  `review_text` varchar(256) NOT NULL,
  `email` varchar(128) NOT NULL,
  `trek_id` int NOT NULL,
  PRIMARY KEY (`email`,`trek_id`),
  KEY `trek_id` (`trek_id`),
  CONSTRAINT `reviews_ibfk_1` FOREIGN KEY (`trek_id`) REFERENCES `trek` (`trek_id`),
  CONSTRAINT `reviews_ibfk_2` FOREIGN KEY (`email`) REFERENCES `customer_account` (`email`),
  CONSTRAINT `reviews_chk_1` CHECK (((`trek_rating` >= 1) and (`trek_rating` <= 10))),
  CONSTRAINT `reviews_chk_2` CHECK (((`camping_rating` >= 1) and (`camping_rating` <= 10)))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
