DROP TABLE IF EXISTS `trek`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `trek` (
  `trek_id` int NOT NULL AUTO_INCREMENT,
  `trek_name` varchar(128) NOT NULL,
  `trek_location` varchar(128) NOT NULL,
  `trek_duration` int NOT NULL,
  `altitude` int NOT NULL,
  `permits_required` tinyint(1) NOT NULL DEFAULT '0',
  `open_from` date NOT NULL,
  `open_till` date NOT NULL,
  `permit_charges` decimal(10,2) DEFAULT '0.00',
  `trek_difficulty_rating` int DEFAULT NULL,
  `base_cost` decimal(10,2) NOT NULL,
  `minimum_age` int NOT NULL,
  `maximum_age` int NOT NULL,
  `organised_by` int NOT NULL,
  PRIMARY KEY (`trek_id`),
  UNIQUE KEY `trek_name` (`trek_name`),
  KEY `organised_by` (`organised_by`),
  CONSTRAINT `trek_ibfk_1` FOREIGN KEY (`organised_by`) REFERENCES `branch` (`branch_id`),
  CONSTRAINT `trek_ibfk_2` FOREIGN KEY (`organised_by`) REFERENCES `branch` (`branch_id`),
  CONSTRAINT `trek_ibfk_3` FOREIGN KEY (`organised_by`) REFERENCES `branch` (`branch_id`),
  CONSTRAINT `trek_chk_1` CHECK ((`trek_duration` > 0)),
  CONSTRAINT `trek_chk_2` CHECK ((`altitude` > 0)),
  CONSTRAINT `trek_chk_3` CHECK ((`permit_charges` >= 0)),
  CONSTRAINT `trek_chk_4` CHECK (((`trek_difficulty_rating` > 0) and (`trek_difficulty_rating` <= 10)))
) ENGINE=InnoDB AUTO_INCREMENT=48 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
